import classes from "./Card.module.css";

const Card = (props) => {
  return (
    <section
      className={`${classes.card} ${
        props.sort === "p1" ? classes.apples : classes.oranges
      }`}
    >
      {props.children}
    </section>
  );
};

export default Card;
